import React from "react";
import TitleAndCaption from './TitleAndCaption'; // title component
import GalleryGrid from '../actual_components/GalleryGrid'; // img gallery component

import image1 from '../assets/hackathons/weve.jpeg';
import image2 from '../assets/hackathons/weve.jpeg';
import image3 from '../assets/hackathons/weve.jpeg';

function HomePage() {
    return (
      <div>
        <TitleAndCaption 
          title="Welcome to My Gallery"
          caption="Browse some of the projects and work I've done recently."
        />
      </div>
    );
  }

function HackathonsPage() {
  const galleryItems = [
    {
      imageSrc: image1,
      linkHref: 'https://link-to-page-1.com',
      altText: 'Image 1 description',
    },
    {
      imageSrc: image2,
      linkHref: 'https://link-to-page-2.com',
      altText: 'Image 2 description',
    },
    {
      imageSrc: image3,
      linkHref: 'https://link-to-page-3.com',
      altText: 'Image 3 description',
    },
    // add more if you want
  ];

  return (
    <div>
      <GalleryGrid items={galleryItems} />
    </div>
  );
}

export default HackathonsPage;
